<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>Un pilote (<b>driver</b> en anglais) est un petit programme qui permet à un système d'exploitation de reconnaitre une composante informatique (matériel) et de pouvoir l'utiliser. En général, chaque périphérique a son propre pilote. Sans pilote, l'imprimante ou la carte graphique par exemple, ne pourraient pas être utilisées. Chaque périphérique doit avoir le pilote compatible avec le système d'exploitation installé sur la machine pour pouvoir fonctionner. C'est pour cette raison que votre imprimante par exemple est fournie avec une disquette ou un CD. Le CD contient le ou les pilotes pour l'imprimante (avec en général quelques logiciels supplémentaires). Ainsi, quand vous connectez une nouvelle imprimante, il vous suffit d'installer le pilote pour que vos logiciels puissent l'utiliser directement, sans avoir à connaître les particularités de cette imprimante. C'est la même chose pour les autres périphériques: il existe des pilotes pour les cartes graphiques, les cartes son, les numériseurs, les cartes réseau, les modems, etc. Il est donc important, quand vous installez ou réinstallez votre système d'exploitation, d'avoir tous ces pilotes sous la main, sinon vous ne pourrez pas utiliser certains de vos périphériques. Généralement, les systèmes d'exploitation sont fournis avec un ensemble de pilotes pour les périphériques les plus courants (pilotes génériques) ainsi, il arrive souvent que vous n'ayez pas à installer les pilotes pour votre carte son ou votre souris: le système d'exploitation détecte et installe les pilotes correspondants.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
