#include &lt;linux/init.h&gt;
//===============================================
MODULE_LICENSE("GPL");
MODULE_AUTHOR("Gerard KESSE [ReadyDev]");
MODULE_DESCRIPTION("Driver de la carte ReadyBoard");
//===============================================
static int __init GReadyBoard_init(void) {
    printk("Chargement du driver de la carte ReadyBoard...\n");
    return 0;
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="creation-d-un-module-de-noyau-linux_gestion-de-la-fermeture-du-module" href="#creation-d-un-module-de-noyau-linux">Gestion de la fermeture du module</a>
</h2><br>Gestion de la fermeture du module:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
