    printk("Fermeture du driver de la carte ReadyBoard...\n");
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="creation-d-un-module-de-noyau-linux_enregistrement-de-la-fonction-de-chargement-du-module" href="#creation-d-un-module-de-noyau-linux">Enregistrement de la fonction de chargement du module</a>
</h2><br>Enregistrement de la fonction de chargement du module:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// readyboard.c
//===============================================
