#include &lt;linux/init.h&gt;
//===============================================
MODULE_LICENSE("GPL");
MODULE_AUTHOR("Gerard KESSE [ReadyDev]");
MODULE_DESCRIPTION("Driver de la carte ReadyBoard");
//===============================================
static int __init GReadyBoard_init(void) {
    printk("Chargement du driver de la carte ReadyBoard...\n");
    return 0;
}
//===============================================
static void __exit GReadyBoard_exit(void) {
    printk("Fermeture du driver de la carte ReadyBoard...\n");
}
//===============================================
module_init(GReadyBoard_init);
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="creation-d-un-module-de-noyau-linux_enregistrement-de-la-fonction-de-fermeture-du-module" href="#creation-d-un-module-de-noyau-linux">Enregistrement de la fonction de fermeture du module</a>
</h2><br>Enregistrement de la fonction de fermeture du module:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// readyboard.c
//===============================================
#include &lt;linux/module.h&gt;
#include &lt;linux/init.h&gt;
//===============================================
MODULE_LICENSE("GPL");
MODULE_AUTHOR("Gerard KESSE [ReadyDev]");
MODULE_DESCRIPTION("Driver de la carte ReadyBoard");
//===============================================
static int __init GReadyBoard_init(void) {
    printk("Chargement du driver de la carte ReadyBoard...\n");
    return 0;
}
//===============================================
static void __exit GReadyBoard_exit(void) {
    printk("Fermeture du driver de la carte ReadyBoard...\n");
}
//===============================================
module_init(GReadyBoard_init);
module_exit(GReadyBoard_exit);
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="creation-d-un-module-de-noyau-linux_fichier-makefile" href="#creation-d-un-module-de-noyau-linux">Fichier Makefile</a>
</h2><br>Fichier Makefile:<br><br><pre class="GCode1 Code1 AceCode" data-mode="makefile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
# Makefile
#================================================
obj-m += readyboard.o
#================================================
all: modules
#================================================
modules:
	make -C /lib/modules/$(shell uname -r)/build M=$(PWD) modules
clean:
	make -C /lib/modules/$(shell uname -r)/build M=$(PWD) clean
#================================================</pre><br><h2 class="GTitle1 Title1">
